        React.createElement("path", { d: "M4 2.5c0-.28.22-.5.5-.5h11c.28 0 .5.22.5.5v15a.5.5 0 01-.5.5h-11a.5.5 0 01-.5-.5v-15zm4 7V17h7V3H5v14h2V9.5a.5.5 0 011 0z", fill: primaryFill }));
};
